import './Card.css';

export default function Card({name, image, type}){
    return(
        <div className='card'>
        <div>
            <h3>{name}</h3>
            <ul>
                {
                     type.map(tip=> tip +', ')
                }
            </ul>
            <img src={image} alt="Image not found" width="300px" height="300px"/>
        </div>
        </div>

    );
}
